 _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 12px; color: black;"" class=""ng-star-inserted"">0.0</span><!----><!----></td></tr><tr _ngcontent-lwe-c90=""""><td _ngcontent-lwe-c90="""" width=""25%""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 12px; color: black;"" class=""ng-star-inserted""><strong _ngcontent-lwe-c90="""">Total Tax:</strong></span><!----><!----></td><td _ngcontent-lwe-c90="""" width=""25%""><!----><!----></td></tr></table><!----></td></tr><tr _ngcontent-lwe-c90="""" style=""border-bottom: 2px solid #000000;""><td _ngcontent-lwe-c90="""" width=""100%"" style=""padding: 0px 12px; font-family: Calibri; font-size: 12px; color: black; border-bottom: 2px solid #000000;""><span _ngcontent-lwe-c90="""" class=""ng-star-inserted""><strong _ngcontent-lwe-c90="""">Place of Supply:</strong></span><!----><!---->&nbsp;&nbsp; <!----><span _ngcontent-lwe-c90="""" class=""ng-star-inserted"">NA</span><!---->&nbsp;&nbsp;&nbsp; <span _ngcontent-lwe-c90="""" class=""ng-star-inserted""><strong _ngcontent-lwe-c90="""">State Name/Code of Supplier:</strong></span><!----><!---->&nbsp;&nbsp; <span _ngcontent-lwe-c90="""">Delhi/DL</span></td></tr><tr _ngcontent-lwe-c90="""" height=""10px""></tr><tr _ngcontent-lwe-c90=""""><td _ngcontent-lwe-c90="""" style=""padding: 0px 10px;""><table _ngcontent-lwe-c90="""" width=""100%""><tr _ngcontent-lwe-c90=""""><td _ngcontent-lwe-c90="""" width=""100%""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px; color: black;"" class=""ng-star-inserted""><strong _ngcontent-lwe-c90=""""><u _ngcontent-lwe-c90="""">INSTRUCTIONS:</u></strong></span><!----><!----></td></tr><tr _ngcontent-lwe-c90=""""><td _ngcontent-lwe-c90="""" width=""100%""><table _ngcontent-lwe-c90="""" border=""0"" width=""100%"" align=""center"" style=""font-family: Calibri; font-size: 11px; color: black;"" class=""ng-star-inserted""><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">1.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">Prescribed Original ID proofs are:- Voter Identity Card / Passport / PAN Card / Driving License / Photo ID card issued by Central / State Govt. / Public Sector Undertakings of State / Central Government ,District Administrations , Municipal bodies and Panchayat Administrations which are having serial number / Student Identity Card with photograph issued by recognized School or College for their students / Nationalized Bank Passbook with photograph /Credit Cards issued by Banks with laminated photograph/Unique Identification Card ""Aadhaar"", m-Aadhaar, e-Aadhaar. /Passenger showing the Aadhaar/Driving Licence from the ""Issued Document"" section by logging into his/her DigiLocker account considered as valid proof of identity. (Documents uploaded by the user i.e. the document in ""Uploaded Document"" section will not be considered as a valid proof of identity).</span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">2.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">PNRs having fully waitlisted status will be dropped and automatic refund of the ticket amount after deducting the applicable CLERKAGE by Railway shall be credited to the account used for payment for booking of the ticket. Passengers having fully waitlisted e-ticket are not allowed to board the train. However, the names of PARTIALLY waitlisted/confirmed and RAC ticket passenger will appear in the chart and will be allowed to board the train.</span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">3.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">Passengers travelling on a fully waitlisted e-ticket will be treated as Ticketless. </span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">4.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">Obtain certificate from the TTE /Conductor in case of (a) PARTIALLY waitlisted e-ticket when LESS NO. OF PASSENGERS travel, (b)A.C FAILURE, (c)TRAVEL IN LOWER CLASS. This original certificate must be sent to GGM (IT), IRCTC, Internet Ticketing Centre, IRCA Building, State Entry Road, New Delhi-110055 after filing TDR online within prescribed time for claiming refund. </span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">5.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">In case, on a party e-ticket or a family e-ticket issued for travel of more than one passenger, some passengers have confirmed reservation and others are on RAC or waiting list, full refund of fare, less clerkage, shall be admissible for confirmed passengers also subject to the condition that the ticket shall be cancelled online or online TDR shall be filed for all the passengers upto thirty minutes before the scheduled departure of the train. </span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">6.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">In case train is late more than 3 hours, refund is admissible as per railway refund rules only when TDR is filed by the user before the actual departure of the train at boarding station and passenger has not travelled.</span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">7.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">In case of train cancellation on its entire run, full refund is granted automatically by the system. However, if the train is cancelled partially on its run or diverted and not touching boarding/destination station, passengers are required to file online TDR within 72 hours of scheduled departure of the train from passengers boarding station. </span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">8.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">Never purchase e-ticket from unauthorized agents or persons using their personal IDs for commercial purposes. Such tickets are liable to be cancelled and forfeited without any refund of money, under section (143) of the Indian Railway Act 1989. List of authorized agents are available on www.irctc.co.in under 'Find NGet Agents' option.</span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">9.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">For detail, Rules, Refund rules, Terms &amp; Conditions of E-Ticketing services, Travel Insurance facility etc. Please visit www.irctc.co.in </span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">10.</span></td><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px 0px 0px 5px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">While booking this ticket, you have agreed of having read the Health Protocol of Destination State of your travel. You are again advised to clearly read the Health Protocol advisory of destination state before start of your travel and follow them properly. </span></td></tr><tr _ngcontent-lwe-c90="""" class=""ng-star-inserted""><td _ngcontent-lwe-c90="""" valign=""top"" style=""text-align: justify; padding: 0px;""><span _ngcontent-lwe-c90="""" style=""font-family: Calibri; font-size: 11px;"">11.</span></td><td